import React from "react";
import {web} from "../src/images/img2.svg";
import { NavLink } from "react-router-dom";
import Common from "./Common";
 
const Home = ()=>{
    return(
        <>
        <Common
        name="lets do something good.."
         imgsrc={web} 
         visite="/service"
          btname="get start"/>
        </>
        );
    };
    export default  Home;
